settings.dashboardCss:
.card .bars-row {
    flex: 1;
    display: flex;
    flex-direction: row;
}

.card .bar-column {
    flex: 1;
    display: flex;
    flex-direction: column;
}


.container {
   width: 100%;
   height: 100%;
   box-sizing: border-box;
   display: flex;
   flex-direction: column;
}

.card > img {
    height: 0;
}

.card .content {
   flex: 1;    
   padding: 13px 13px 0;
   display: flex;
   box-sizing: border-box;
}

.card .content .column {
   display: flex;
   flex-direction: column;    
   justify-content: space-around;
   flex: 1;
}

.card .content .title-row {
    display: flex;
    flex-direction: row;
    padding-bottom: 10px;
}

.card .title {
    flex: 1;
    font-size: 20px;
    font-weight: 400;
    color: #666666;
}

.card .state {
    text-transform: uppercase;
    font-size: 20px;
    font-weight: bold;
}

.card.enabled .state {
    color: #00B260;
}

.card.warning .state {
    color: #FFAD6F;
}

.card.disabled .state {
    color: #F73243;
}

.card .bar-container {
    flex: 1;
    display: flex;
    flex-direction: column;
    justify-content: center;
}

.card .bar {
    flex: 1;
    max-height: 30px;
    margin-top: 3.5px;
    margin-bottom: 4px;
    background-color: #F0F0F0;
    border: 1px solid #DADCDB;
    border-radius: 2px;
    box-shadow: inset 0 1px 3px rgba(0, 0, 0, .2);
}

.card.enabled .bar {
    border-color: #00B260;
    background-color: #F0FBF7;
}

.card.warning .bar {
    border-color: #FFAD6F;
    background-color: #FFFAF6;
}

.card.disabled .bar {
    border-color: #F73243;
    background-color: #FFF0F0;
}

.card .bar .bar-fill {
    background-color: #F0F0F0;
    border-radius: 2px;
    height: 100%;
    width: 0%;
}

.card.enabled .bar-fill {
    background-color: #00C46C;
}

.card.warning .bar-fill {
    background-color: #FFD099;
}

.card.disabled .bar-fill {
    background-color: #FF9494;
}

.card .bar-labels {
    height: 20px;
    font-size: 16px;
    color: #666;
    display: flex;
    flex-direction: row;
}


.markdown .mat-mdc-button-base {
    text-transform: uppercase;
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
}

.markdown .mdc-button__label {
    pointer-events: none;
}

.action-row {
    display: flex;
    flex-direction: row;
    justify-content: flex-end;
    padding: 8px 0;
}

@media screen and (min-width: 960px) and (max-width: 1279px) {
  .container .title {
      font-size: 12px;
  }
  .container .state {
      font-size: 12px;
  }
  .container .unit {
      font-size: 8px;
  }
  .container .bar-labels {
      font-size: 8px;
  }
  .container .mat-mdc-button-base {
      font-size: 8px;
  }
  .container .action-row {
      padding: 0;
  }
}

@media screen and (min-width: 1280px) and (max-width: 1599px) {
  .container .title {
      font-size: 14px;
  }
  .container .state {
      font-size: 14px;
  }
  .container .unit {
      font-size: 10px;
  }
  .container .bar-labels {
      font-size: 10px;
  }
  .container .mat-mdc-button-base {
      font-size: 10px;
  }
  .container .action-row {
      padding: 0;
  }
}

@media screen and (min-width: 1600px) and (max-width: 1919px) {
  .container .title {
      font-size: 16px;
  }
  .container .state {
      font-size: 16px;
  }
  .container .unit {
      font-size: 12px;
  }
  .container .bar-labels {
      font-size: 12px;
  }
  .container .mat-mdc-button-base {
      font-size: 12px;
  }
  .container .action-row {
      padding: 0;
  }
}
